import React from "react";
import Hero from "./components/hero";
import "./index.css";
import ContactPage from './pages/contactpage'
import { Box } from "@mui/material";
import Container from "@mui/material/Container";

import ProjectHoverCard from "./components/project-hover-card";
import {Paper} from "@mui/material";
import MiniContact from "./components/mini-contact";
import AboutMe from "./pages/about";



import SocialBar from "./components/social-bar";

function LandingPage() {
  return (
    <div>
      <main>
        <Hero />
<Box>
  
          <div id="hidden" className="hidden">
            <ProjectHoverCard />{" "}
            <Paper elevation={3} height='100vh' maxWidth='100%' 
                sx={{
                    marginTop: 0,
                    backgroundImage: "url('/assests/uniken.png')",
                    backgroundClip: "content-box",
                    backgroundSize: "cover",
                    backgroundPosition: "'bottom',",
                    backgroundRepeat: "no-repeat",
                    color: "white",
                    }} >
              <div id="about" >
                <AboutMe />
              </div>
            </Paper>
          </div>
</Box>

  
          <div id="contact">
                 <ContactPage />
          </div>
    

      
      </main>
    </div>
  );
}

export default LandingPage;
